public class TypeCastingExp {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		int a=20;
		float t=40.6f;
		float z;
		int x;
		//z=a;
		//x=a;
		x=(int)t;
		double v=33.333339;
		z=(float)v;
		
		System.out.println("Value of int to float="+x);
		
		System.out.println("Value of floatto double int="+z);
		
		
	}

}
